stage.code:
/// <summary>
/// Compares DataRow by column name and value.
/// In contrast to System.Data.DataRowComparer (Txt='A',Nr=1) equals (Nr=1,Txt='A')
/// </summary>
public class DataRowValueComparer : IEqualityComparer<DataRow>
{
	private static readonly DataRowValueComparer _default = new DataRowValueComparer();
	public static DataRowValueComparer Default => _default;

	public bool Equals(DataRow x, DataRow y)
	{
		return x.Table.Columns.Count == y.Table.Columns.Count &&
			x.Table.Columns.Cast<DataColumn>().All(c => y.Table.Columns.Contains(c.ColumnName) && y[c.ColumnName].Equals(x[c.ColumnName]));
	}

	public int GetHashCode(DataRow obj)
	{
		return obj.ItemArray.Aggregate(0, (hash, val) => hash ^ val.GetHashCode());
	}
}
